const filters = components.table1.filters.filter(
  (row) => !["status", "application type", "assigned to"].includes(row.column)
);

await components.table1.clearFilters();

if (components.status_dropdown.value != "All") {
  filters.push({
    column: "status",
    condition: "equals",
    value: `${components.status_dropdown.value}`,
  });
}

if (components.application_type_dropdown.value != "All") {
  filters.push({
    column: "application type",
    condition: "equals",
    value: `${components.application_type_dropdown.value}`,
  });
}

if (
  page.name == "All applications" &&
  components.assigned_to_dropdown.value != "All"
) {
  filters.push({
    column: "assigned to",
    condition: "equals",
    value: `${components.assigned_to_dropdown.value}`,
  });
}

await components.table1.setFilters(filters);
